(1, 'Privacy Policy', 'privacy-policy', '<p><strong>Introduction</strong></p><p>This Privacy Policy describes how we collect, use, and share personal information when you visit or use our online eCommerce platform (the \"Platform\").</p><p><br></p><p><strong>What Information Do We Collect?</strong></p><p>We collect the following types of personal information from you:</p><ul><li>Contact information:&nbsp;Name, email address, phone number, and mailing address</li><li>Payment information:&nbsp;Credit or debit card number, billing address, and shipping address</li><li>Account information:&nbsp;Username, password, and purchase history</li><li>Demographic information:&nbsp;Age, gender, and location</li><li>Other information:&nbsp;Any other information you provide to us, such as product reviews, customer service inquiries, and social media posts</li></ul><p><br></p><p><strong>How Do We Use Your Information?</strong></p><p>We use your personal information for the following purposes:</p><ul><li>To process your orders and fulfill your requests</li><li>To provide you with customer service and support</li><li>To send you promotional emails and other marketing materials</li><li>To improve our Platform and services</li><li>To protect our rights and interests</li></ul><p><br></p><p><strong>How Do We Share Your Information?</strong></p><p>We may share your personal information with the following third parties:</p><ul><li>Service providers:&nbsp;We may share your personal information with third-party service providers who help us operate our Platform and provide our services, such as payment processors, shipping carriers, and customer service providers.</li><li>Business partners:&nbsp;We may share your personal information with third-party business partners who offer products and services that we believe may be of interest to you.</li><li>Law enforcement and other government agencies:&nbsp;We may share your personal information with law enforcement and other government agencies if we are required to do so by law or if we believe it is necessary to protect our rights or interests or the rights or interests of others.</li></ul><p><br></p><p><strong>Your Choices</strong></p><p>You have the following choices regarding your personal information:</p><ul><li>Opt-out of marketing communications:&nbsp;You can opt out of receiving promotional emails and other marketing materials from us by clicking on the unsubscribe link at the bottom of any marketing email you receive from us.</li><li>Access and correct your information:&nbsp;You can access and correct your personal information by logging into your account on the Platform or by contacting us at [email protected]</li><li>Delete your information:&nbsp;You can request that we delete your personal information by contacting us at [email protected]</li></ul><p><br></p><p><strong>Data Security</strong></p><p>We take reasonable measures to protect your personal information from unauthorized access, use, disclosure, alteration, or destruction. However, no method of data transmission or storage is completely secure. As such, we cannot guarantee the absolute security of your personal information.</p><p><br></p><p><strong>Changes to This Privacy Policy</strong></p><p>We may update this Privacy Policy from time to time. If we make any changes, we will post the updated Privacy Policy on the Platform. We encourage you to review this Privacy Policy periodically to stay informed about how we are collecting, using, and sharing your personal information.</p><p><br></p><p><strong>Contact Us</strong></p><p>If you have any questions about this Privacy Policy, please contact us at <a href=\"mailto:xclusivemart.us@gmail.com\" rel=\"noopener noreferrer\" target=\"_blank\">xclusivemart.us@gmail.com</a></p>', 3, 3, 0, 1, 1, 1, NULL, '2023-10-30 10:32:33', '2023-11-04 07:19:03'),
(2, 'Terms of Service', 'terms-of-service', '<p>Welcome to <strong>xclusivemart.shop</strong></p><p><br></p><p>These terms of service (the \"Terms of Service\") govern your use of the xclusivemart.shop online eCommerce platform (the \"Website\"). The Website is owned and operated by Xclusivemart.</p><p>By using the Website, you agree to be bound by these Terms of Service. If you do not agree to these Terms of Service, you may not use the Website.</p><p><br></p><p><strong>1. Use of the Website</strong></p><p>You may use the Website to browse and purchase products and services offered by Xclusivemart and its third-party vendors. You agree to use the Website in a responsible and lawful manner and in accordance with these Terms of Service.</p><p><br></p><p><strong>2. Eligibility</strong></p><p>To use the Website, you must be at least 18 years old and have the capacity to enter into a binding contract. You also agree to provide accurate and complete information about yourself when using the Website.</p><p><br></p><p><strong>3. Account Creation</strong></p><p>To purchase products and services on the Website, you must create an account. When creating an account, you agree to provide accurate and complete information about yourself. You also agree to keep your account information up-to-date.</p><p><br></p><p><strong>4. Payment</strong></p><p>When you purchase products and services on the Website, you agree to pay the applicable price in full. You may pay using any of the payment methods accepted by the Website.</p><p><br></p><p><strong>5. Shipping</strong></p><p>Xclusivemart will ship the products you purchase to the address you specify. Shipping costs will be calculated and displayed at checkout.</p><p><br></p><p><strong>6. Returns and Refunds</strong></p><p>You may return products purchased on the Website within 30 days of receipt for a full refund. To return a product, you must contact Xclusivemart customer service and obtain a return authorization number. You must then return the product in its original packaging, unused and in its original condition.</p><p><br></p><p><strong>7. Intellectual Property</strong></p><p>The Website and its contents are protected by copyright, trademark, and other intellectual property laws. You agree not to copy, reproduce, distribute, or otherwise exploit the Website or its contents without the express written permission of Xclusivemart.</p><p><br></p><p><strong>8. Disclaimer of Warranties</strong></p><p>The Website is provided \"as is\" and without any warranties. Xclusivemart does not warrant that the Website will be uninterrupted, error-free, or secure. Xclusivemart also does not warrant that the Website or its contents will be accurate, complete, or timely.</p><p><br></p><p><strong>9. Limitation of Liability</strong></p><p>To the fullest extent permitted by law, Xclusivemart shall not be liable for any direct, indirect, incidental, special, or consequential damages arising out of or in connection with your use of the Website.</p><p><br></p><p><strong>10. Governing Law and Jurisdiction</strong></p><p>These Terms of Service shall be governed by and construed in accordance with the laws of the State of Bangladesh. Any disputes arising out of or in connection with these Terms of Service shall be subject to the exclusive jurisdiction of the state and federal courts located in the State of Bangladesh.</p><p><br></p><p><strong>11. Changes to the Terms of Service</strong></p><p>Xclusivemart reserves the right to change these Terms of Service at any time. Any changes to these Terms of Service will be posted on the Website. Your continued use of the Website following any changes to these Terms of Service will constitute your acceptance of the new Terms of Service.</p><p><br></p><p><strong>Contact Us</strong></p><p>If you have any questions about these Terms of Service, please contact Xclusivemart customer service at <a href=\"mailto:xclusivemart.us@gmail.com\" rel=\"noopener noreferrer\" target=\"_blank\">xclusivemart.us@gmail.com</a></p>', 3, 3, 0, 1, 1, 1, NULL, '2023-10-30 10:34:18', '2023-11-12 00:34:17'),
(3, 'Data Deletion Instructions', 'data-deletion-instructions', '<p><br></p><p><strong>Facebook Data Deletion Instructions:</strong></p><p><br></p><p><em>To delete your Facebook account and all of your data:</em></p><ol><li>Go to your Facebook account\'s&nbsp;Settings &amp; Privacy.</li><li>Click&nbsp;Settings.</li><li>Click&nbsp;Your Facebook Information.</li><li>Click&nbsp;Delete Your Account and Information.</li><li>Select&nbsp;Delete Account.</li><li>Click&nbsp;Continue to Account Deletion.</li><li>Enter your password and click&nbsp;Delete Account.</li></ol><p><br></p><p><em>Note: Your account will be permanently deleted after 90 days. During this time, you can choose to cancel your deletion request by logging back into your account.</em></p><p><br></p><p><em>To delete specific types of data from your Facebook account:</em></p><ol><li>Go to your Facebook account\'s&nbsp;Settings &amp; Privacy.</li><li>Click&nbsp;Settings.</li><li>Click&nbsp;Your Facebook Information.</li><li>Click&nbsp;Manage Your Information.</li><li>Click the type of data you want to delete.</li><li>Click&nbsp;Delete.</li></ol><p><br></p><p><em>Note: You can delete the following types of data:</em></p><ul><li><em>Posts, photos, and videos</em></li><li><em>Comments and reactions</em></li><li><em>Activity logs</em></li><li><em>Messages</em></li><li><em>Apps and websites</em></li><li><em>Friends and followers</em></li><li><em>Groups and Pages</em></li></ul><p><br></p><p><em>To delete your data from apps and websites that use Facebook Login:</em></p><ol><li>Go to your Facebook account\'s&nbsp;Settings &amp; Privacy.</li><li>Click&nbsp;Settings.</li><li>Click&nbsp;Security and Login.</li><li>Click&nbsp;Apps and Websites.</li><li>Review the list of apps and websites that use Facebook Login.</li><li>Click&nbsp;Remove&nbsp;next to any apps or websites that you want to delete your data from.</li></ol><p><br></p><p><em>Note: You can also delete your data from apps and websites by contacting the developers directly.</em></p><p><br></p><p><em>To download your Facebook information before you delete it:</em></p><ol><li>Go to your Facebook account\'s&nbsp;Settings &amp; Privacy.</li><li>Click&nbsp;Settings.</li><li>Click&nbsp;Your Facebook Information.</li><li>Click&nbsp;Download Your Information.</li><li>Select the types of data you want to download.</li><li>Click&nbsp;Request Download.</li><li>You will receive a link to download your information via email.</li></ol><p><br></p><p><em>Note: You can download your Facebook information in a variety of formats, including JSON, HTML, and CSV.</em></p><p><br></p><p><em>Please note: Deleting your Facebook account and data is a permanent action. Once you have deleted your account, you will not be able to recover it.</em></p>', 1, NULL, 0, 1, 1, 1, NULL, '2023-10-30 11:01:21', '2023-10-30 11:47:10'),
(4, 'About Us', 'about-us', '<p>Welcome to <strong>xclusivemart.shop</strong>, your one-stop shop for all things exclusive and smart! We are a team of passionate individuals who are dedicated to providing our customers with the best possible shopping experience. We offer a wide variety of products, from the latest tech gadgets to stylish fashion accessories. We also have a team of experts who are always on hand to answer your questions and help you find the perfect product for your needs.</p><p>We know that you have many choices when it comes to online shopping, so we are committed to providing you with the best possible service. We offer competitive prices, fast shipping, and a hassle-free return policy. We also have a team of customer service representatives who are always happy to help you with any questions or concerns you may have.</p><p>We are confident that you will be happy with your shopping experience at <strong>xclusivemart.shop</strong>. We invite you to browse our selection of products and see for yourself why we are the leading provider of exclusive and smart products.</p><p><br></p><p><strong>Our Mission</strong></p><p>Our mission is to provide our customers with the best possible shopping experience by offering a wide variety of exclusive and smart products at competitive prices. We are committed to providing our customers with the highest level of service and support.</p><p><br></p><p><strong>Our Values</strong></p><p>We believe in the following values:</p><ul><li><strong>Customer satisfaction:</strong>&nbsp;<em>We are committed to providing our customers with the best possible shopping experience.</em></li><li><strong>Quality:</strong>&nbsp;<em>We offer a wide variety of high-quality products at competitive prices.</em></li><li><strong>Innovation:</strong>&nbsp;<em>We are constantly looking for new and innovative products to offer our customers.</em></li><li><strong>Integrity:</strong>&nbsp;<em>We are honest and transparent in all of our dealings with our customers and partners.</em></li><li><strong>Teamwork:</strong>&nbsp;<em>We believe that teamwork is essential to our success. We work together to provide our customers with the best possible shopping experience.</em></li></ul><p><br></p><p>Thank you for choosing <strong>xclusivemart.shop</strong>!</p>', 1, 1, 0, 1, 1, 1, NULL, '2023-10-31 10:18:18', '2023-11-14 02:51:37'),
(5, 'Contact Us', 'contact-us', '<p>At xclusivemart.shop, we value your feedback and strive to provide you with the best possible online shopping experience. If you have any questions, concerns, or suggestions, please don\'t hesitate to contact us. We\'re here to help!</p><p><br></p><p><strong>Contact Information</strong></p><p>Email: <a href=\"mailto:xclusivemart.us@gmail.com\" rel=\"noopener noreferrer\" target=\"_blank\">xclusivemart.us@gmail.com</a></p><p>Phone: <a href=\"tel:+8801915362836\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(5, 5, 5);\">+880 1915-362836</a></p><p>Address: <span style=\"color: rgb(101, 103, 107);\">H-11, W-16, Gazipur City, Gazipur - 1702, Gazipur, Dhaka Division, Bangladesh</span></p><p><br></p><p><strong>Working Hours</strong></p><p>Sunday to Saturday: 9:00 AM to 5:00 PM BST</p><p>(Closed on Public Holidays)</p><p><br></p><p><strong>Social Media</strong></p><p>Facebook: <a href=\"https://www.facebook.com/xclusivemart.fp\" rel=\"noopener noreferrer\" target=\"_blank\">https://www.facebook.com/xclusivemart.fp</a></p>', 1, 2, 0, 1, 1, 1, NULL, '2023-10-31 10:18:32', '2023-11-16 07:18:17'),
(6, 'Return Policy', 'return-policy', '<p><strong>Returning Items</strong></p><p>Please note that we only accept returns for items that are in their original condition and packaging. This means that the item must be unused, unworn, and unwashed. It must also be in the original packaging, including any tags or labels.  <span style=\"color: rgb(0, 0, 0);\">Even though if there is any manufacturing fault or if the delivered product is wrong we are offering an exchange or return facility.</span></p><p>To return an item, please follow these steps:</p><ol><li>Contact us within 7 days of receiving your order to request a return authorization.</li><li><strong style=\"color: rgb(0, 0, 0); background-color: rgb(255, 235, 204);\">To claim a return or exchange you must need to take an unboxing video. Without unboxing the video we will not accept the return or exchange request.</strong></li><li>Once you have received a return authorization, package the item securely in its original packaging.</li><li>Include a copy of your packing slip or order confirmation in the package.</li><li>Ship the package back to us using a trackable shipping method.</li><li>Once we have received and inspected the returned item, we will issue a refund to your original payment method.</li></ol><h2><br></h2><p><strong>Shipping Costs for Returns</strong></p><p>You are responsible for the shipping costs of returning items. We recommend that you use a trackable shipping method to ensure that your return arrives safely.</p><h2><br></h2><p><strong>Non-Returnable Items</strong></p><p>The following items are non-returnable:</p><ul><li>Items that are on sale or have been discounted</li><li>Items that have been personalized or customized</li><li>Items that are damaged or defective</li><li>Items that have been used or worn</li><li>Items that are missing their original packaging, tags, or labels</li></ul><h2><br></h2><p><strong>Refunds</strong></p><p>Refunds are typically processed within 5-7 business days of receiving your return. However, please allow up to 10 business days for your refund to appear on your account, depending on your bank or credit card company.</p><h2><br></h2><p><strong>Exclusions</strong></p><p>We reserve the right to refuse a return or refund for any reason.</p><h2><br></h2><p><strong>Contact Us</strong></p><p>If you have any questions about our return policies, please contact us at <a href=\"mailto:xclusivemart.us@gmail.com\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255);\">xclusivemart.us@gmail.com</a></p>', 3, 2, 0, 1, 1, 1, NULL, '2023-11-11 22:19:37', '2023-11-12 00:37:28');
